script: |
  super -f text -I q12512.spq | sort > q12512.out

inputs:
  - name: q12512.spq
    data: |
      SELECT - - 67 col1 FROM tab2 (FORMAT parquet) WHERE - 26 NOT BETWEEN 25 + - + 20 / + CAST ( NULL AS INTEGER ) * col2 + col2 AND - - col0;
  - name: tab2

outputs:
  - name: q12512.out
    data: |
